script: |
  super -f text -I q12930.spq | sort > q12930.out

inputs:
  - name: q12930.spq
    data: |
      SELECT + + col0 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + col1 * - 80 IN ( col2 * + - col2 * col0 / + - 27, 47, - 59, - col2, 13 + - ( - + 48 ) );
  - name: tab1

outputs:
  - name: q12930.out
    data: |
      51
      85
      91
